var tipuesearch = {"pages":[{"title":"About","tags":"misc","text":"2016Fall 修課成員網誌","url":"./pages/about/"},{"title":"w10 4連桿Excel超級製圖員","tags":"Misc","text":"Solvedpace平面4連桿模擬kappa: 用點座標在excel畫圖kappa get: 繪圖流程, 導入程式庫, 啟動, 然後引用各種模組開始繪圖 window.onload=function(){ brython(1); } from browser import document as doc import math # 準備繪圖畫布 canvas = doc[\"japanflag1\"] ctx = canvas.getContext(\"2d\") # 以下可以利用 ctx 物件進行畫圖 # 先畫一條直線 ctx.beginPath() # 設定線的寬度為 1 個單位 ctx.lineWidth = 1 # 將畫筆移動到 (100, 100) 座標點 ctx.moveTo(100, 100) # 然後畫直線到 (150, 200) 座標點 ctx.lineTo(150, 200) # 畫右上左下的斜線 ctx.moveTo(150, 100) ctx.lineTo(100, 200) # 設定顏色為藍色, 也可以使用 \"rgb(0, 0, 255)\" 字串設定顏色值 ctx.strokeStyle = \"blue\" # 實際執行畫線 ctx.stroke() ctx.closePath() This is the end of this week!!!","url":"./w10-4lian-gan-excelchao-ji-zhi-tu-yuan.html"},{"title":"2016FallCADP之~Solvespace 參數化零組件設計繪圖之~I will be HOKAGE!!","tags":"Misc","text":"超級w4~Solvespace 參數化零組件設計繪圖 網誌 Category 網誌 Tags reveal.js 使用導引","url":"./2016fallcadpzhi-solvespace-can-shu-hua-ling-zu-jian-she-ji-hui-tu-zhi-i-will-be-hokage.html"},{"title":"w7拼裝核4大怪獸四連木旱之---可以幫我\"你的名字\"的同人作畫按讚嗎霸脫","tags":"Misc","text":"這是這禮拜的拼裝核4大怪獸四連木旱 這是棒棒圖檔 -可以點來看 P.S都沒人幫我點讚霸脫進來幫我點讚!!! This is the end of this week!!!","url":"./w7pin-zhuang-he-4da-guai-shou-si-lian-mu-han-zhi-ke-yi-bang-wo-ni-de-ming-zi-de-tong-ren-zuo-hua-an-zan-ma-ba-tuo.html"}]};